  false,\n\t\"url\": null,\n\t\"notes\": \"Between 26 May and 24 June 1984 two personnel
  were stationed at the base camp cabin in Aga Cove along the eastern shore of Agattu
  Island. Working from the base camp, the crew conducted an intensive survey for returning
  and nesting geese. Initially the work concentrated on documenting the returning
  geese in Aga Cove and the surrounding areas. All Aleutian Canada geese observed
  were recorded and attempts were made to discern the presence or absence of leg bands.
  Band numbers were read and recorded whenever possible using binoculars and spotting
  scopes.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
